import React from 'react';
import styled from 'styled-components';
import MenuButton from './MenuButton';

const Menu = styled.div`
    position: fixed;
    display: flex;
    justify-content: space-between;
    bottom: 0;
    width: 560px;
    background-color: #efefef;
    height: 120px;
    left: 50%;
    padding: 15px 40px;
    padding-bottom: 10px;
    transform: translateX(-50%);
    border-top-left-radius: 25px;
    border-top-right-radius: 25px;
`;

class Menubar extends React.Component {
    menus = [
        {
            icon:'home',
            color:'red',
            text:'Home'
        },
        {
            icon:'info',
            color:'green',
            text:'Introduce'
        },
        {
            icon:'code',
            color:'blue',
            text:'Project'
        }
    ];

    renderMenus = (arr) => {
        return arr.map(a=>{
            return <MenuButton icon={a.icon} color={a.color} text={a.text}/>
        });
    };

    render() {
        return (
            <Menu>
                <MenuButton icon="home" color="red" text="Home"/>
                <MenuButton icon="info" color="green" text="Introduce"/>
                <MenuButton icon="code" color="blue" text="Project"/>
            </Menu>
        )
    }
}

export default Menubar;
